import React from "react";
import { NavLink } from "react-router-dom";
import "./ComponentSearch.css";
import { Table } from "antd";
export default function ComponentSearch() {
  const columns = [
    { title: "STT" },
    { title: "Trường Tiểu học" },
    { title: "Quận/Huyện" },
    { title: "Mã học sinh" },
    { title: "Lớp" },
    { title: "Họ và tên" },
    {
      title: "Ngày sinh",
      children: [
        {
          title: "Ngày",
        },
        {
          title: "Tháng",
        },
        {
          title: "Năm",
        },
      ],
    },
    { title: "Giới" },
    { title: "Nơi sinh" },
    { title: "Dân tộc" },
    { title: "Hộ khẩu" },
    { title: "Điện thoại" },
    {
      title: "Điểm sơ tuyển vòng 1 ( Tổng )",
      children: [
        {
          title: "Lớp 1",
        },
        {
          title: "Lớp 2",
        },
        {
          title: "Lớp 3",
        },
        {
          title: "Lớp 4",
        },
        {
          title: "Lớp 5",
        },
        {
          title: "Điểm ưu tiên",
        },
        {
          title: "Tổng điểm",
        },
      ],
    },
  ];
  return (
    <>
      <div className="form-import-container">
        <div className="form-import-content">
          <div className="form-import">
            <div className="title-content">
              <div className="title">
                <h2>THÊM THÔNG TIN SINH VIÊN</h2>
              </div>
              <div className="body-text">
                <div className="body-text-router">
                  <NavLink
                    className="effect-hover"
                    to="/"
                    style={{ color: "#fff" }}
                  >
                    Thêm thông tin
                  </NavLink>
                  <NavLink
                    className="active-router effect-hover"
                    to="/FormSearch"
                    style={{ color: "#fff" }}
                  >
                    Tra cứu thông tin
                  </NavLink>
                </div>
                <div className="body-text-input">
                  <p style={{ marginTop: "35px" }}>
                    Chú ý: dấu (*) là bắt buộc nhập
                  </p>
                  <div className="input-info">
                    <span>(*)</span>
                    <input
                      className=""
                      placeholder="Nhập họ và tên học sinh (VD: Nguyễn Văn Minh)"
                      data-val-required="Yêu cầu nhập họ tên học sinh."
                    ></input>
                  </div>
                  <div className="input-info">
                    <span>(*)</span>
                    <input
                      className=""
                      placeholder="Nhập mã học sinh (VD: 01176GHAK)"
                      data-val-required="Yêu cầu nhập mã học sinh"
                    ></input>
                  </div>
                </div>
              </div>
            </div>
            <div className="body-content">
              <div className="mb-3">
                {/* <input
                  className="form-control"
                  type="file"
                  id="formFile"
                  onChange={(e) => {
                    setSeclectFie(e.target.files[0]);
                  }}
                /> */}
              </div>

              {/* <input
                type="file"
                onChange={(e) => {
                  setSeclectFie(e.target.files[0]);
                }}
              ></input> */}
              <button className="sumit-form-import">Tìm kiếm</button>
            </div>
          </div>
          <Table
            className="table-search"
            rowKey="id"
            columns={columns}
            bordered
          >
            bbb
          </Table>
        </div>
      </div>
    </>
  );
}
